const fungi_img = 'data:image/jpeg;base64,'

const petri_img = 'data:image/jpeg;base64,'

const machine_img = 'data:image/jpeg;base64,'

const biome_img = 'data:image/jpeg;base64,'

const mushroom_img = 'data:image/jpeg;base64,'

const embryo_img = 'data:image/jpeg;base64,'

const long_embryo_img = 'data:image/png;base64,'

const styles = [fungi_img, petri_img, embryo_img, machine_img, biome_img, mushroom_img]


let description = `aquatic or bacterial or biological or botanical or floral or fungal or marine or mineral or zoological or coral or mollusc or organism or gemstone, 
                microscopy, 3d, sharp focus, sophisticated, intricate, neurons, cells, luminate, transparent, particles, muted colors, octane`

const extra_prompt = "";
const url = 'http://' + 'localhost:7777'
let seed = -1;

let current_img = undefined;
let count = 0;
let reset = false;
let style_id = 5;

let text = document.querySelector("#chat");

function isIntegerInRange(text, min, max) {
    const number = Number(text); // Convert text to a number
    // Check if it's an integer and within the specified range
    if (Number.isInteger(number) && number >= min && number <= max) {
        return true;
    } else {
        return false;
    }
}

text.addEventListener("keydown", async (e) => {
  if (e.key === "Enter" && text.value.length !== 0) {
    if(text.value == 'r') {
        console.log('resetting');
        reset = true;
    }
    else if(parseInt(text.value)) {
        const n = parseInt(text.value);
        if(n > 0 && n < 6) {
            console.log(text.value);
            style_id = parseInt(text.value);
        }
    }
    text.value = "";
  }
});

async function generate() {
  const person_img = await captureFrame(); 
  if(reset) {
    current_img = undefined;
    reset = true;
  }
  request_img2img_reference(description, current_img ? current_img : embryo_img, person_img, 512, 512) // todo: current image 
  .then(data => {
    // console.log(data.images[0]);
    current_img = 'data:image/jpeg;base64,' + data.images[0];
    draw_canvas();
    save_canvas();
  })
}

setInterval(generate, 3000); // Repeat every 1 second (1000 milliseconds)

function draw_canvas() {
    var canvas = document.getElementById('gen');
    var ctx = canvas.getContext('2d');  
  
    var image = new Image();
    image.onload = function() {
      ctx.drawImage(image, 0, 0);
    };
    image.src = current_img;
}

function formatNumber(num, length) {
  return num.toString().padStart(length, '0');
}

function save_canvas() {
  console.log('saving...');

  // Get the canvas element
  var canvas = document.getElementById('gen');

  // Convert canvas to data URL
  var dataURL = canvas.toDataURL('image/png');

  // Create a download link
  var link = document.createElement('a');
  link.href = dataURL;
  link.download = 'canvas_'+ formatNumber(count, 5) +'.png';
  count = count + 1;
  document.body.appendChild(link);

  // Trigger the download
  link.click();

  // Clean up
  document.body.removeChild(link);
}

async function captureFrame() {
  var video = document.getElementById('video');
  var canvas = document.createElement('canvas');
  var ctx = canvas.getContext('2d');
  
  canvas.width = video.videoWidth;
  canvas.height = video.videoHeight;

  // Draw the current frame of the video onto the canvas
  ctx.drawImage(video, 0, 0, canvas.width, canvas.height);

  // Convert canvas image to Base64 string
  var base64Image = canvas.toDataURL('image/jpeg');

  // Do something with the Base64 image
  return base64Image;
}

var request = {
    url: "",
    method: "POST",
    body: '',
}

var request_in_progress = false;

const request_img2img_reference = async (prompt, img, ref_img, w = 512, h = 512, steps = 20) => {
  console.log('controlnet:', url, style_id); // debug
  
  if(request_in_progress) {    
      return null;
  }
  request_in_progress = true;

  request.url = url + '/sdapi/v1/img2img';
  request.method = 'POST';
  request.body = JSON.stringify({
      "prompt": prompt + extra_prompt, // todo
      "seed": seed,
      "batch_size": 1,
      "steps": steps,
      "cfg_scale": 4.5, // 4.5
      "width": w,
      "height": h,
      "negative_prompt": 'animation, grid, drawing, painting, clay',
      "sampler_index": 'Euler a',
      "denoising_strength": 0.25, //0.25 //0.55
      "init_images": [img],
      "alwayson_scripts": {
          "controlnet":{
              "args":[
                  {
                      "input_image": ref_img,
                      "module": 'shuffle',
                      "model": "control_v11e_sd15_shuffle [526bfdae]",
                      "lowvram": false,
                      "weight": 0.5,
                      "pixel_perfect": true,
                      "guidance_start": 0.5,
                      "guidance_end": 1.0,
                      "control_mode": 0,
                  },
                  {
                    "input_image": styles[5],
                    "module": 'reference_adain+attn',
                    "lowvram": false,
                    "weight": 0.76,
                    "pixel_perfect": true,
                    "guidance_start": 0.1,
                    "guidance_end": 0.9,
                    "control_mode": 0,
                }
              ]
          }
      }
  });

  try {
      const response = await fetch(request.url, {
          method: request.method,
          // mode: 'no-cors',
          headers: {
              'Accept': 'application/json',
              'Content-Type': 'application/json',
          },
          body: request.body,
      });
  
      const json = await response.json();
      request_in_progress = false;
  
      return json;
  } catch (error) {
      
  }
}

